import React, { useEffect, useState } from 'react';
import Card from '@mui/material/Card';
import CardMedia from '@mui/material/CardMedia';
import CardActions from '@mui/material/CardActions';
import Button from '@mui/material/Button';
import Grid from '@mui/material/Grid';
import Dialog from '@mui/material/Dialog';
import DialogContent from '@mui/material/DialogContent';

function Content() {
  const [rawData, setRawData] = useState('');
  const [mediaItems, setMediaItems] = useState([]);
  const [openDialog, setOpenDialog] = useState(false);
  const [selectedMedia, setSelectedMedia] = useState({});

  useEffect(() => {
    const params = new URLSearchParams(window.location.search);
    const dataParam = params.get('data');

    if (dataParam) {
      setRawData(dataParam);
    }
  }, []);

  useEffect(() => {
    try {
      const data = JSON.parse(rawData);

      if (Array.isArray(data)) {
        setMediaItems(data);
        console.log('Datos analizados:', data);
      }
    } catch (error) {
      console.error('Error al analizar datos en bruto:', error);
    }
  }, [rawData]);

  const openMediaInNewTab = (mediaUrl) => {
    window.open(mediaUrl, '_blank');
  };

  const handleMediaClick = (media) => {
    setSelectedMedia(media);
    setOpenDialog(true);
  };

  const handleCloseDialog = () => {
    setOpenDialog(false);
  };

  return (
    <div>
      {mediaItems.length > 0 ? (
        <div>
          <Grid container spacing={2}>
            {mediaItems.map((item, index) => (
              <Grid item xs={12} sm={6} md={4} key={index}>
                <Card
                  sx={{
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                  }}
                >
                  <CardMedia
                    component="div"
                    sx={{
                      pt: '75%',
                      backgroundColor: 'blue',
                      cursor: 'pointer',
                    }}
                    image={item.baseUrl}
                    onClick={() => handleMediaClick(item)}
                  />
                  <CardActions sx={{ backgroundColor: '#eaeff1' }}>
                    <Button size="small">Edit</Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>

          <Dialog open={openDialog} onClose={handleCloseDialog}>
            <DialogContent>
              {selectedMedia.mimeType && selectedMedia.mimeType.startsWith('image') ? (
                <img src={selectedMedia.baseUrl} alt="FullScreen" style={{ width: '100%', height: 'auto' }} />
              ) : selectedMedia.mimeType && selectedMedia.mimeType.startsWith('video') ? (
                <video controls width="100%" height="100%" autoPlay={true} onEnded={handleCloseDialog}>
                  <source src={selectedMedia.baseUrl} type="video/mp4" />
                  Tu navegador no soporta el tag de video.
                </video>
              ) : (
                <p>Tipo de medio no soportado</p>
              )}
            </DialogContent>
          </Dialog>
        </div>
      ) : (
        <p>No hay imágenes o videos para mostrar.</p>
      )}
    </div>
  );
}

export default Content;
